export default (function(a,b,c,d,e,f,g,h,i){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},OHbTMIwpxe:{data:{id:2459,attributes:{imdbId:"tt0054483",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMmFjZmJlMzItMTJhMC00MmVjLWE3ZGYtN2Q0YWFkZjlhM2I5XkEyXkFqcGdeQXVyMzU4Nzk4MDI@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"},{Source:"Rotten Tomatoes",Value:"38%"}],item_lang:{data:{id:3122,attributes:{title:e,plot:"Robert Lomax, tired of working in an office, wants to be an artist. So he moves to Hong Kong to try his hand at painting. Finding a cheap hotel, he checks in, only to find it's used by prostitutes and their \"dates\" they meet in the bar downstairs. Since he never picks up any of the ladies, they all want to know more about him. Eventually, he does hire one to model for him... and soon falls in love. However, since he's on a limited budget, he can't afford her exclusively, but doesn't want to \"share\" her with anyone else.",slug:"the-world-of-suzie-wong"}}},books:{data:[{id:11885,attributes:{title:e,description:"A re-issue of a bestseller which the 1960 film starring Nancy Kwan and William Holden is based Robert is t he only resident of the Nam Kok hotel not renting his room by the hour when he meets Suzie at the bar. She becomes his muse and they fall in love. But even in Hong Kong, where many white expatriates have Chinese mistresses, their romance could jeopardize the things they each hold dear. Set in the mid-1950s, The World of Suzie Wong is a beautifully written time capsule of a novel. First published more than fifty years ago, it resonated with readers worldwide, inspiring a film starring William H olden, a ballet, and even a reggae song. Now readers can experience the romance of this groundbreaking story anew.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ARNKAzFQx_4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2012-01-31",publisher:"Penguin",subtitle:"A Novel"}},{id:11886,attributes:{title:"Suzie Wong (The World of Suzie Wong, Dt.) Roman",description:a,thumbnail:a,authors:[b],firstBook:d,published:"1958-01-01",publisher:a,subtitle:a}},{id:11887,attributes:{title:e,description:a,thumbnail:a,authors:[b],firstBook:d,published:"1967-01-01",publisher:a,subtitle:a}},{id:11888,attributes:{title:"The Shadow and the Peak",description:"Douglas Lockwood came to Jamaica to recover from the heartbreak of a messy divorce. But instead of peace he found passion, and three women who threatened to turn the island idyll into a summer storm . . . The school at which Douglas has come to teach is perched on an isolated hilltop, and its pupils run wild while the staff are engaged in their own private wars. The headmaster's wife is trying to tempt him into an affair, but his heart lies with Judy, an air hostess he rescued from a plane crash. And in the background is Sylvia, an uncontrollable young girl who is madly in love with him and caught up in an adult world she doesn't understand. A gorgeously cinematic novel, The Shadow and the Peak is a gripping story by the bestselling author of The World of Suzie Wong. It was filmed in 1958 as Passionate Summer, starring Virginia McKenna and Bill Travers.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WJ4qDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:h,publisher:i,subtitle:a}},{id:11889,attributes:{title:"The Wind Cannot Read",description:"Winner of the 1948 John Llewellyn Rhys Prize A poignant novel of forbidden love, The Wind Cannot Read is the story of Michael Quinn, an English airman, who falls in love with Sabby, his Japanese teacher, in India during the Second World War. \"Enemies\" in the eyes of his friends and fellow soldiers, they must keep their romance a secret in the face of great danger. And tragedy awaits them both when Quinn is sent behind enemy lines in Burma . . . Cinematic in both its scope and depth of feeling, The Wind Cannot Read was made into a film starring Dirk Bogarde and Yoko Tani in 1958. Richard Mason's descriptive powers are at their zenith in this touching wartime romance, which is a must-read for anyone who loved his timeless bestseller, The World of Suzie Wong.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=xiPhDgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:h,publisher:i,subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309591616}}("","Richard Mason","movie",null,"The World of Suzie Wong","series",1,"2017-07-13","Pan Macmillan"))